import React from 'react';

import CreateRoomButton from '../IndexButtons/CreateRoomButton';
import JoinRoomButton from '../IndexButtons/JoinRoomButton';

import './join-room-state.css';

export default function IndexStateTwo(props) {
	return (
		<div className="index-state-two">
			<div className="find-room">
				<JoinRoomButton
                        		onClick = {props.onClick}
                        		>
				</JoinRoomButton>                
			</div>

			<CreateRoomButton
				onClick = {props.onClick}
				>	
			</CreateRoomButton>




		</div>
	);

}
